  \"AIRS/Aqua Level 2 Cloud-cleared infrared radiances (AIRS+AMSU+HSB) V005\",\n\t\"tracking_summary\":
  {\n\t\t\"total\": 6,\n\t\t\"recent\": 0\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\":
  [],\n\t\"revision_timestamp\": \"2015-05-07T02:33:42.004657\",\n\t\"name\": \"airs-aqua-level-2-cloud-cleared-infrared-radiances-airsamsuhsb-v005\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"This product is similar to AIRI2CCF. However,
  it contains science retrievals that use the Humidity Sounder for Brazil (HSB). Because
  the HSB instrument lived only from September 2002 through January 2003 when it terminally
  failed, the data set covers these five months only.n            n            Cloud-Cleared
  Radiances contain calibrated, geolocated channel-by-channel AIRS infrared radiances
  (milliWatts/m2/cm-1/steradian) that would have been observed within each Advanced
  Microwave Sounding Unit (AMSU) footprint if there were no clouds in the FOV and
  produced along with the AIRS Standard Product, as they are the radiances used to
  retrieve the Standard Product. Nevertheless, they are an order of magnitude larger
  in data volume than the remainder of the Standard Products and, many Standard Product
  users are expected to have little interest in the Cloud Cleared Radiance. For these
  reasons they are a separate output file, but like the Standard Product, are generated
  at all locations.n            n            (The Shortname for this product is AIRH2CCF).\",\n\t\"license_title\":
